import React from "react";
import { Typography, Divider, Box } from "@material-ui/core";

export const MyFooter = () => {
  return (
    <Box mt={8} style={{ position: "absolute", bottom: 0 }}>
      <Divider />
      <Typography align="center">Created by Raphael</Typography>
    </Box>
  );
};
